if mibBuilder.loadTexts: cdx6500LfcmLinkStaticAllowToGoTo.setDescription("The set of WAN Bridge Links to which frames received from a specific port and destined for a specific MAC address, are allowed to be forwarded. Each octet within the value of this object specifies a set of eight bridge links, with the first octet specifying links 1 through 8, the second octet specifying links 9 through 16, etc. Within each octet, the most significant bit represents the lowest numbered link, and the least significant bit represents the highest numbered link. Thus, each link of the bridge is represented by a single bit within the value of this object. If that bit has a value of '1' then that link is included in the set of links; the link is not included if its bit has a value of '0'. (Note that the setting of the bit corresponding to the link from which a frame is received is irrelevant.)")
